&amp;lsquo;लोकान्तर राउण्ड अप&amp;rsquo;मा पाठकवृन्दलाई स्वागत छ । सधैँझैँ आज पनि हामी बितेको २४ घण्टाका मुख्यमुख्य घटनाक्रमसहित उपस्थित भएका छौँ&amp;ndash;
काठमाडौं महानगरपालिकाका मेयर बालेन साहको सक्रियताले राष्ट्रिय राजनीति तरंगित बनेको छ ।

ललितप

चितवनमा भएको मोटरसाइकल दुर्घटनामा एक जनाको मृत्यु भएको छ ।&amp;nbsp;

मृत्यु हुनेमा माडी नगरपालिका&amp;ndash;१ गर्दी का २० वर्षीय तृशल महतो रहेका छन् । उनी सोही मोटरसाइकलका चालक हुन् ।

जिल्ला प्रहरी कार्यालयका प्रहरी नायब उपरीक्षक रवीन्द्र खनालका अन

बैंकिङ क्षेत्र सुधार सुझाव कार्यदलले बुझाएको प्रतिवेदन सार्वजनिक भएको छ ।&amp;nbsp;

गत जेठमा गठन गरिएको उच्चस्तरीय बैंकिङ क्षेत्र सुधार सुझाव कार्यदलले बुझाएको प्रतिवेदन हालै राष्ट्र बैंकले सार्वजनिक गरेको हो ।&amp;nbsp;

कार्यदलको प्रतिवेदनले लघुवि

देशभर पश्चिमी वायुको आंशिक प्रभाव रहेको &amp;nbsp;छ ।&amp;nbsp;

जल तथा मौसम विज्ञान विभागको मौसम पूर्वानुमान महाशाखाका अनुसार हाल तराईका धेरै स्थानमा हुस्सु लागेको छ ।&amp;nbsp;

कोशी, बागमती र गण्डकी प्रदेशका पहाडी तथा हिमाली भूभागमा आंशिक बदली रहे

नेपाली कांग्रेसको केन्द्रीय कार्यसम्पादन समितिको बैठक आज &amp;nbsp;शुक्रबार पनि बस्दैछ ।&amp;nbsp;

बैठक शुक्रबार दिउँसो १ बजे पार्टी केन्द्रीय कार्यालय सानेपा, ललितपुरमा बस्नेछ ।&amp;nbsp;

बुधबारदेखि शुरू बैठकमा हालसम्म उपसभापति धनराज गुरुङ, महामन्
